from typing import List


class Solution:
    def __init__(self):
        self.actives = None
        self.m = None
        self.n = None
        self.mat = None

    def isValidPlace(self,i,j):
        return (i in range(self.n)) and (j in range(self.m))
    def neighbors(self,i,j):
        L=[]
        for (di,dj) in [(0,1),(0,-1),(1,0),(-1,0)]:
            ki,kj=i+di,j+dj
            if not self.isValidPlace(ki,kj):
                continue
            L.append((ki,kj))
        return L
    def negateAndReturnZeros(self):
        zeros=set()
        for i in range(self.n):
            for j in range(self.m):
                if self.mat[i][j]==0:
                    zeros.add((i,j))
                else:
                    self.mat[i][j]=-1
        return zeros
    def find_new_actives(self):
        actives=set()
        for (i,j) in self.actives:
            for (ki,kj) in self.neighbors(i,j):
                if self.mat[ki][kj]==-1:
                    actives.add((ki,kj))
        self.actives=actives

    def updateMatrix(self, mat: List[List[int]]) -> List[List[int]]:
        self.mat=mat
        n=len(mat)
        m=len(mat[0])
        self.n=n
        self.m=m
        self.actives=self.negateAndReturnZeros()
        cur=0
        while len(self.actives)>0:
            cur+=1
            self.find_new_actives()
            for (i,j) in self.actives:
                self.mat[i][j]=cur
        return self.mat






